import React from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';


function UserInput() {


  return (


    <div>
      <Stack sx={{ width: "33%", mx: 'auto', my: '1rem'}} spacing={2} >
        <Alert severity="info">This page is to help you create SQL queries for the database.</Alert>
      </Stack>

      <Accordion>
        <AccordionSummary
          expandIcon={<ArrowDownwardIcon />}
          aria-controls="panel1-content"
          id="panel1-header"
        >
          <Typography>Accordion 1</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
            malesuada lacus ex, sit amet blandit leo lobortis eget.
          </Typography>
        </AccordionDetails>
      </Accordion>

      <p>
        <br />
        Please choose relevant phrase from the buttons below and fill in the blanks.<br />
        Here are some examples of queries you can make:<br />
        - What is Doctor Tan's ID?<br />
        - What is the name of the patient with ID 001?<br />
        - Which date did Doctor Tan issued the prescription with ID 010?<br />
        - What is the dosage for the medication with ID 100?<br />
      </p>

      <Stack direction="row" spacing={2} justifyContent="center">
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Patients
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Doctors
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Prescriptions
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Medications
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Prescription Details
        </Button>
      </Stack>

      <br />

      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1, width: '75ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        {/* <TextField id="filled-basic" label="Filled" variant="filled" />
        <TextField id="standard-basic" label="Standard" variant="standard" /> */}
      </Box>

    </div>
  );
}

export default UserInput;
